import axios from "axios";

const Index = ({ posts }) => (
  <div>
    <h1>Index Page</h1>
  </div>
);

Index.getInitialProps = async () => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const data = res.data;
  console.log(data[0]);
  return { posts: data };
};

export default Index;
